webpackJsonp([0xb2c50d39511c380],{"./node_modules/json-loader/index.js!./.cache/json/csharp-do-while-loop.json":function(e,o){e.exports={data:{markdownRemark:{html:'<h1>Do while Loop</h1>\n<p>The <code>do while</code> loop executes a block of code once and until a condition is false. They are a particular case of <a href=\'https://guide.freecodecamp.org/csharp/while-loop\' target=\'_blank\' rel=\'nofollow\'><code>while</code> loops</a>: they execute a block of code one time and then until the condition is false. A common use of <code>do while</code> loops are input checks.</p>\n<h2>Example</h2>\n<div class="gatsby-highlight">\n      <pre class="language-none"><code>string input = "";\ndo\n{\n\tConsole.WriteLine("Type A to continue: ");\n\tinput = Console.ReadLine();\n} while(input != "A");\n\nConsole.WriteLine("Bye!");</code></pre>\n      </div>\n<h2>Output:</h2>\n<div class="gatsby-highlight">\n      <pre class="language-none"><code>> Type A to continue: b\n> Type A to continue: g\n> Type A to continue: A\n> Bye!</code></pre>\n      </div>',fields:{slug:"/csharp/do-while-loop/"},frontmatter:{title:"Do while loop"}}},pathContext:{slug:"/csharp/do-while-loop/"}}}});
